import styled from 'styled-components';
import Responsive from './Responsive';
import Button from './Button';

const HeaderBlock = styled.div`
  position: fixed;
  width: 100%;
  background: white;
  box-shodow: 0px 2px 4px rgba(0, 0, 0, 0.08);
`;

const Wrapper = styled(Responsive)`
  height: 4rem;
  display: flex;
  align-itemns: center;
`;

const Header = () => {
  return (
    <HeaderBlock>
      <Wrapper>
        <div className="logo"></div>
        <div className="right">
          <Button> 로그인</Button>
        </div>
      </Wrapper>
    </HeaderBlock>
  );
};

export default Header;
